import React, { Component } from 'react';
import './Home.css';

class Home extends Component {
    render() {
        return (
            <div>
                <video autoplay="autoplay" loop="loop" muted className="Video">
                    <source src={require('./dudu.mp4')} type="video/mp4"/>
                </video> 
                <div className='caption' align="center">
                    <h1>BREAKFAST</h1>
                </div>
            </div>

        );
    }
}

export default Home;
